import React from "react";

const Form = props => {
	console.log(props);
	return (
		<form>
			<label>
				Name: {props.name}
				<input type="text" name="name" />
			</label>
			<input type="submit" value="Submit" />
			<p onClick={props.changeHandler}>dfssd</p>
		</form>
	);
};

export default Form;
